export default function FilterButton({
  name = '',
  value = '',
  onclickHandler = () => {},
}) {
  return (
    <button
      type="button"
      name={name}
      value={value}
      onClick={onclickHandler}
      className="btn btn-success btn-sm"
    >
      {value}
    </button>
  )
}
